import React, { Component } from 'react';
import SideMenu from './side-menu';
import CovidCarrierStatus from './covid-carrier-status';
import CovidCarrierNumber from './covid-carrier-number';
import CovidTestedNumber from './covid-tested-number';
import CovidPatientData from './covid-patient-data';
import CovidNewsList from './covid-news';
import CovidAdviceCenter from './covid-advice-center';
import CovidCallCenter from './covid-call-center';

class App extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="container">
          <div className="row">
            <div className="col-12 col-md-3">
              <SideMenu />
            </div>
            <div className="col-12 col-md-9 my-3">
              <div className="row">
                <div className="col-12 col-md-12">
                  <CovidNewsList />
                </div>
                <div className="col-12 col-md-6">
                  <CovidCarrierNumber />
                </div>
                <div className="col-12 col-md-6">
                  <CovidTestedNumber />
                </div>
                <div className="col-12 col-md-12">
                  <CovidCarrierStatus />
                </div>
                <div className="col-12 col-md-12">
                  <CovidPatientData />
                </div>
                <div className="col-12 col-md-6">
                  <CovidAdviceCenter />
                </div>
                <div className="col-12 col-md-6">
                  <CovidCallCenter />
                </div>
              </div>
            </div>
          </div>
          <iframe src="https://e.infogram.com/c2903dda-3c88-45f5-802b-ee3c364ddd81?src=embed" title="ワクチン接種数" width="700" height="2610" scrolling="no" frameborder="0" style="border:none;" allowfullscreen="allowfullscreen"></iframe><div style="padding:8px 0;font-family:Arial!important;font-size:13px!important;line-height:15px!important;text-align:center;border-top:1px solid #dadada;margin:0 30px;width: 640px"><a href="https://infogram.com/c2903dda-3c88-45f5-802b-ee3c364ddd81" style="color:#989898!important;text-decoration:none!important;" target="_blank">ワクチン接種数</a><br /><a href="https://infogram.com" style="color:#989898!important;text-decoration:none!important;" target="_blank" rel="nofollow">Infogram</a></div>
        </div>
      </div>
    );
  }
}

export default App;
